function sumZero(arr) {
  let i = 0; //-3

  while (i < arr.length) {
    for (let j = 1; j < arr.length; j++) {
      if (arr[i] !== 0 && arr[i] + arr[j] === 0) {
        return [arr[i], arr[j]];
      }
    }
    i++;
  }
}

const sumZeroValue = sumZero([-3, -2, -1, 0, 1, 14]);

console.log(sumZeroValue);

/** Average Pair */

function avgPair(arr, pair) {
  if (!arr.length) {
    return false;
  }
  let isPair = false;
  let i = 0;
  while (i < arr.length) {
    for (let j = 1; j < arr.length; j++) {
      if (arr[i] + arr[j] / 2 === pair) {
        isPair = true;
      }
    }

    return isPair;
  }
}

console.log(avgPair([1, 0, 3, 4, 5, 6], 4.1));

/** Sort Arry without sort function 0,1,2 */

function unSortArry(arr) {
  let i = 0;
  let j = 1;
  while (i <= arr.length) {
    if (arr[i] > arr[j]) {
      let temp = 0;
      arr[j] = temp;
      arr[j] = arr[i];
      arr[i] = temp;
    }
    j++;
    i++;
  }
  return arr;
}

